import '../styles/scss/index.scss';

import React from 'react';
import { ThemeProvider } from 'styled-components';

import Theme from '../styles/theme';

export default function MyApp({ Component, pageProps }) {
  return (
    <ThemeProvider theme={Theme}>
      <Component {...pageProps} />
    </ThemeProvider>
  );
};
